(7, 2, 3, 'utiro', 'utiro', 'rurie', '', '2017-08-30'),
(8, 3, 2, 'Innovative Sustainable System in Energy - Food - Water Nexus', 'Innovative-Sustainable-System-in-Energy-Food-Water-Nexus', '<p><strong>Background:</strong><br />\r\nWith huge population growth and unstable economic problem, nowadays, the challenges on securing the needs of energy, water, and food (E-W-F) become a big issue. The connection of the E-W-F aspects offer ascent to the requirement for handling the difficulties with a nexus approach. The discussion between the research progresses between E-W-F aspects is vital for better comprehension the complicity of E-W-F nexus and adopting coordinated strategies for the next progress.<br />\r\n<br />\r\nThe ASTECHNOVA 2017 is to host communication and dissemination of proposed new approaches in dealing with E- W-F nexus issues, as studying complexity and knowledge management. The papers on the issues relating to technology innovations and policy implementation of the E- W-F nexus s are welcomed. This event is the third international energy conference. Since 2014 till 2016 the conference was held successfully and attended by several participants and experts from Japan, Cuba, Cambodia, Vietnam, Philippines, Nepal, South Africa, China, Japan, Cuba and USA.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Scopes:</strong></p>\r\n\r\n<p>The ASTECHNOVA 2017 -International Energy Conference- will systematically examine the following topics</p>\r\n\r\n<ul>\r\n	<li>Oil and gas</li>\r\n	<li>New and renewable energy</li>\r\n	<li>Nuclear engineering</li>\r\n	<li>Green technologies</li>\r\n	<li>Energy management and services</li>\r\n	<li>Environmental compliance</li>\r\n	<li>Plant engineering and instrumentation &amp; control</li>\r\n	<li>Energy efficiency</li>\r\n	<li>Nexus from the energy perspective related to water and food</li>\r\n	<li>Future clean energy technologies and systems under water and food constrains</li>\r\n	<li>Land, climate and energy constraints on water and food sectors</li>\r\n	<li>Future urban energy systems with considerations of water and food security</li>\r\n	<li>Technology innovations for supporting global secure access to clean energy and water</li>\r\n	<li>Other relevant topics on energy &ndash; water &ndash; food nexus.</li>\r\n</ul>\r\n\r\n<p><strong>Rationale:</strong></p>\r\n\r\n<p>Department of Nuclear Engineering and Engineering Physics, Universitas Gadjah Mada (DNEEP) is currently in the process of being a centre of excellent in energy system as part of the global institution. The most important aspects in the preparation for being a centre of excellent in energy system is the internationally scientific atmosphere in DNEEP. Department of Nuclear Engineering and Engineering Physics, Universitas Gadjah Mada should be joint to the international community in energy system with prominent researchers and practitioners from industry and academia in energy system. Therefore, it is crucial to an international conference to bring together researchers and practitioners from industry and academia for sharing their energy technological development.</p>\r\n\r\n<p>In the conference, many well recognized researchers, practitioners and academia will share their experience and vision of the future technological development in energy system. Among others, there will be the scientific members, i.e. Prof. Sunil Chirayath (Texas A&amp;M University, USA), Dr. Liem Peng Hong (NAIS Co., Inc, Japan), Prof. Agus Pulung Sasmito (McGill University, Canada), Prof. Christophe Demaziere (Chalmers University of Technology, Sweden), Hiroshige Kikura (Tokyo Institute of Technology), Prof. Sunarno, Prof. Phillip Beeley (Khalifa University, United Arab Emirates), Prof. Yonghee Kim (KAIST, South Korea), Dr. Jim Kuijper (NUCLIC, Netherlands) Dr.-Ing. Sihana (Universitas Gadjah Mada, Indonesia), Dr. Gea O.F. Parikesit (Universitas Gadjah Mada, Indonesia), Dr. Totok Soehartanto (Institut Teknologi Sepuluh Nopember, Indonesia) and Dr. Jarot Setyowiyoto (Universitas Gadjah Mada, Indonesia), Prof. Dr. Ing. Ir. Misri Gozan, M.Tech (Universitas Indonesia, Indonesia), Prof. John Z. Zhai (University of Colorado Boulder). DNEEP believes that conducting the ASTECHNOVA 2017 - International Energy Conference - is a strategic initiative to open more networks to the prominent energy system researchers and practitioners from industry and academia in the world whose opinions and suggestions will help DNEEP to excel as a centre of excellent in energy system.</p>\r\n\r\n<p><strong>Aims:</strong></p>\r\n\r\n<ol>\r\n	<li>To bring together researchers and practitioners from industry and academia to give overviews of the state of the art of technology developments in energy system,</li>\r\n	<li>To present recent achievements of advanced technology developments in energy system</li>\r\n	<li>To exchange ideas and experiences in the field of technology developments in energy system.</li>\r\n</ol>\r\n', '', '2017-08-30'),
